import React,{Component} from 'react';
import EmployeeMaster from '../Schema/employee_master'
import Form from 'react-jsonschema-form'
import API from 'axios'

const uischema = {
   "EmployeeMasterBank" : {
       "ui:disabled" : true
       },
    "EmployeeIdentificationDetails" :{
       "ui:disabled" : true
    },
    "EmployeeOfficeDetails":{
       "ui:disabled" : true
    }
}



export default class EmployeePersonalDetails extends Component{
    constructor(props) {
        super(props);
        this.handleSubmit = this.handleSubmit.bind(this)
        this.onError = this.onError.bind(this)
    }
    onError(error){
      console.log(error)
    }
    handleSubmit(formData){
        console.log(formData.formData)
        API.post("http://localhost:3000/EmployeeDetails",formData.formData)
            .catch(res =>{console.log(res,formData.formData)})
    }
    render() {
        return(
            <div>
                <Form onSubmit={this.handleSubmit} onError={this.onError} schema={EmployeeMaster.definitions.EmployeeDetails} uiSchema={uischema}></Form>
            </div>
        )
    }
}
